import React from "react";
import { IoIosSend } from "react-icons/io";

const Comments = () => {
  return (
    <div className="comments">
      <input
        type="text"
        placeholder="Enter your Comment..."
        className="comments-input"
      />
      <IoIosSend size={20} color="black" />
    </div>
  );
};

export default Comments;
